import { useContext } from "react";

import axios from "../utils/axios";
import UserContext from "../contexts/UserContext";

const After = () => {
  const { checkContext } = useContext(UserContext);
  return (
    <Button
      variant="contained"
      color="error"
      onClick={() =>
        axios.get("/logout").then(({ data }) => {
            console.log(data)
          if (data.success) {
            checkContext();
          }         
        })
      }
    >
      Sign Out
    </Button>
  );
};

export default After;
